import React from 'react'
import { Outlet } from "react-router-dom";
import { getNotes } from '../assets/data'
import ListItem from '../components/ListItem'

const NotesPage = () => {
    let notes = getNotes();
    return (
        <div>
            {notes.map(note => (
                <ListItem note={note} key={note.id} />
            ))}
            <Outlet />
        </div>
    )
}

export default NotesPage
